export default function Footer() {
  return (
    <div><div className="card bg-light text-center" style={{backgroundColor:"rgb(153, 245, 214)"}}>
    <div className="card-header ">
      <h4 style={{backgroundColor:"rgb(153, 245, 214)",color:"blue"}}>Contact</h4> 
    </div>
    <div className="card-body">
      
    
      <a href="https://www.linkedin.com/in/suryansh-pandey-031223252/" className="btn mt-2"><FontAwesomeIcon icon={faLinkedin} beatFade /> Linkedin </a><br/>
      <a href="https://github.com/suryansh6393" className="btn mt-2"><FontAwesomeIcon icon={faGithub} beatFade /> Github </a><br/>
       
    </div>
  </div></div>
  )
}
